import request from '@/utils/request';
export function login(data) {
  return request({
    url: '/user/login',
    method: 'post',
    data: data
  });
}
export function getUserInfo() {
  return request({
    url: '/user/getUserInfo',
    method: 'get'
  });
}
export function logout() {
  return request({
    url: '/user/logout',
    method: 'get'
  });
}
export function getInviteUrl() {
  return request({
    url: '/user/invite_code',
    method: 'get'
  });
}
